    return(
        <div>
            My Todo App
            <Login/>
        </div>
    );
}

function Login() {

    const [username, setUsername] = useState('username');
    const [password, setPassword] = useState('password');
    return(
        <div>
            <div>
                <label for="username"> Username </label>
                <input type = "text" name = "username" value = {username} onClick = {(event) => setUsername(event.target.value)} />
            </div>
            
            <div>
                <label for="password"> Password </label>
                <input type = "text" name = "password" value = {password} onClick = {(event) => setPassword(event.target.value)} />
            </div>
            <button onClick = {() => loginClick(username, password)}> Login </button>
        </div>
    );
}

